import React, { useEffect, useState } from 'react';
import axios from 'axios';


import './styles/Connect.css'; // adapte le chemin selon ton projet

const Connect = () => {
  
  const [isClient, setIsClient] = useState(true);
  const [clientData, setClientData] = useState({ telephone: '', motdepasse: '' });
  const [livreurData, setLivreurData] = useState({ email: '', motdepasse: '' });


  const handleClientSubmit = async (e) => {
    e.preventDefault();
    try {
      const res = await axios.post('/api/client/loginUser', clientData);
      console.log('✅ Client connecté :', res.data);
      // redirection, token, etc.
    } catch (err) {
      console.error('❌ Erreur client :', err.response?.data || err.message);
    }
  };

  const handleLivreurSubmit = async (e) => {
    e.preventDefault();
    try {
      const res = await axios.post('/api/livreur/loginUser', livreurData);
      console.log('✅ Livreur connecté :', res.data);
    } catch (err) {
      console.error('❌ Erreur livreur :', err.response?.data || err.message);
    }
  };

  return (
    <div className="all connect-page">
      <h2>
        <span>B</span>ienvenue sur la page de Connexion jjjbjjjjjjgjgjgjgjuug<br />
        Merci <span>de bien remplir les</span> champs
      </h2>

      <div className="giga">
        <div className="indic">
          <button id="droite" onClick={() => setIsClient(true)}>Client</button>
          <button id="gauche" onClick={() => setIsClient(false)}>Livreur</button>
        </div>

        <div className="giga-form">
          
            <div className="all-form">
              <div className="lpm">
                <h1>Connexion Client</h1>
                <form onSubmit={handleClientSubmit}>
                  <div className="tgh">
                    <div className="seul">
                      <div className="btn14">
                        <label htmlFor="telephone">Téléphone</label>
                        <i id="bi" className="bi bi-envelope-fill"></i>
                        <input
                          type="tel"
                          name="telephone"
                          id="telephone"
                          placeholder="abcde1234@gmail.com"
                          required
                        />
                      </div>
                    </div>
                    <div className="meute">
                      <div className="btn1">
                        <label htmlFor="motdepasse">Mot de passe</label>
                        <i className="bi bi-lock-fill"></i>
                        <input
                          type="password"
                          name="motdepasse"
                          id="motdepasse"
                          placeholder=""
                          required
                        />
                      </div>
                    </div>
                    <div className="btn2">
                      <input type="submit" value="S'enregistrer" />
                    </div>
                  </div>
                </form>
              </div>
            </div>
  
            <div className="all-form">
              <div className="lpm">
                <h1>Connexion Livreur</h1>
                <form onSubmit={handleLivreurSubmit}>
                  <div className="tgh">
                    <div className="seul">
                      <div className="btn14">
                        <label htmlFor="email">Email</label>
                        <i id="bi" className="bi bi-envelope-fill"></i>
                        <input
                          type="email"
                          name="email"
                          id="email"
                           value={livreurData.motdepasse}
                    onChange={(e) => setLivreurData({ ...livreurData, motdepasse: e.target.value })}
                          required
                        />
                      </div>
                    </div>
                    <div className="meute">
                      <div className="btn1">
                        <label htmlFor="motdepasse">Mot de passe</label>
                        <i className="bi bi-lock-fill"></i>
                        <input
                          type="password"
                          name="motdepasse"
                          id="motdepasse"
                           value={livreurData.motdepasse}
                    onChange={(e) => setLivreurData({ ...livreurData, motdepasse: e.target.value })}
                          placeholder=""
                          required
                        />
                      </div>
                    </div>
                    <div className="btn2">
                      <input type="submit" value="S'enregistrer" />
                    </div>
                  </div>
                </form>
              </div>
            </div>

          <main
            id="all-form2"
            className={`all-form2 ${isClient ? 'droite' : 'gauche'}`}
            style={{
              borderRadius: isClient ? '30px 0 0 30px' : '0 30px 30px 0',
            }}
          >
            <h3>{isClient ? 'Je suis un client' : 'Je suis un Livreur'}</h3>
          </main>
        </div>
      </div>
    </div>
  );
};

export default Connect;
